import React from "react";
import "./List.css";
import * as restaurantData from "./data/restaurant.json";

class List extends React.Component{
    render(){
        return(
            <ul>
                <li id="first">
                    <div>
                        <img className="imgRestaurant" src="favicon.ico" alt="Le restaurant"></img>
                    </div>
                    <div>
                        <h2>{restaurantData.features}Nom du restaurant</h2>
                        <div className="moyenneAvis">Avis</div>
                        <div className="adresse">Adresse du restaurant</div>
                    </div>
                </li>
                <li>
                    <h2>Nom du restaurant</h2>
                    <div className="moyenneAvis first">Avis</div>
                    <div className="adresse">Adresse du restaurant</div>
                </li>
            </ul>
        );
    }
}

export default List;
